import React from "react"

// Title of Listen Menu
export function HeaderMenuListen() {
  return (<div id="header_menu_listen" className="header_menu_item"  onMouseEnter={changeVisibilityTests}>LISTEN-READ</div>)

  function changeVisibilityTests(e) {
    document.getElementById('list_words_wrapper').style.visibility = 'hidden';
    document.getElementById('list_tests_wrapper').style.visibility = 'hidden';
    document.getElementById('list_listen_wrapper').style.visibility = 'visible';
//    e.target.style.background = 'red';
  }



}
